import React from 'react';

const Navbar = () => {
    return (
        <div className="uk-container">
            <nav className="uk-container">
                <div className="uk-container-left">Teste</div>
                <div className="uk-container-right">Teste2</div>
            </nav>
        </div>
    );
}


export default Navbar;
